    setMinFilter,
    maxFilter,
    setMaxFilter,
    searchFilter,
    setSearchFilter} = props


     const minimoFiltro = (e) => {
        setMinFilter(e.target.value)
     }

     const maximoFiltro = (e) => {
        setMaxFilter(e.target.value)
     }

